import React from 'react';
import { Button, ThemeProvider, createMuiTheme } from '@material-ui/core/Button';

function App() {
  const theme = createMuiTheme({

    status: {
      danger: red[500],
    },
    secondary: {
      main: green[500],
    },

  });
  return (
    <ThemeProvider theme={theme}>
      <Button variant='contained' color="secondary">Daniel</Button>;
    </ThemeProvider>
  )
}

export default App;
